import axios from "axios";

export default class APIService {
  static async getAll() {
    const options = {
      method: "GET",
      url: "https://the-birthday-cake-db.p.rapidapi.com/",
      headers: {
        "X-RapidAPI-Key": "3221264ddbmsh4e813894489d9e2p1f0f4djsncedf4fdaaea7",
        "X-RapidAPI-Host": "the-birthday-cake-db.p.rapidapi.com",
      },
    };

    try {
      const response = await axios(options);
      return response.data;
    } catch (error) {
      console.error(error);
    }
  }
  static async getCakebyId(CakeId) {
    const options = {
      method: "GET",
      url: `https://the-birthday-cake-db.p.rapidapi.com/${cakeId}`,
      headers: {
        "X-RapidAPI-Key": "3221264ddbmsh4e813894489d9e2p1f0f4djsncedf4fdaaea7",
        "X-RapidAPI-Host": "the-birthday-cake-db.p.rapidapi.com",
      },
    };

    try {
      const response = await axios.request(options);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  }
}
